import Reaact from "react";
import Partickel from "react-particles-js";
const Header = () => {
  return (
    <div>
      <Partickel
        params={{
          polygon: {
            enable: true,
            type: "inside",
            move: {
              radius: 10,
            },
            url: "../",
          },
        }}
      />
    </div>
  );
};

export default Header;
